import Jokesdata from './javascript/App.js'
import Joke from './components/Joke.jsx'
export default function App(){
    console.log(Jokesdata)
    const eachJoke=Jokesdata.map((joke)=>{
        return(
            <Joke
                key={joke.id}
                object={jOK}
            />
        )
    })
    return(
        <>
            {eachJoke}
        </>  
    )
}
